import React from "react";

const MenuIcon = (props) => {
  return (
    <svg
      width="33"
      height="20"
      viewBox="0 0 33 20"
      fill="none"
      xmlns="http://www.w3.org/2000/svg"
      {...props}
    >
      <rect width="33" height="2" fill="white" />
      <rect y="9" width="33" height="2" fill="white" />
      <rect x="9.42871" y="18" width="23.5714" height="2" fill="white" />
    </svg>
  );
};

export default MenuIcon;
